import React, { useState } from "react";
import { Card, CardContent } from "@/components/ui/card";
import { Button } from "@/components/ui/button";
import { Heart, ShoppingCart } from "lucide-react";
import { BrowserRouter as Router, Route, Link, Switch } from "react-router-dom";

const products = [
  { id: 1, name: "هاتف ذكي", price: 500, image: "https://via.placeholder.com/150", description: "هاتف ذكي بمواصفات عالية" },
  { id: 2, name: "لابتوب", price: 1200, image: "https://via.placeholder.com/150", description: "لابتوب قوي للأعمال والألعاب" },
  { id: 3, name: "سماعات لاسلكية", price: 150, image: "https://via.placeholder.com/150", description: "سماعات لاسلكية بجودة صوت ممتازة" },
];

function ProductList({ addToCart, toggleFavorite, favorites }) {
  return (
    <div className="p-4 grid grid-cols-1 md:grid-cols-3 gap-4">
      {products.map((product) => (
        <Card key={product.id} className="p-4 shadow-lg rounded-lg text-center">
          <img src={product.image} alt={product.name} className="w-full mb-2" />
          <CardContent>
            <h2 className="text-lg font-bold">{product.name}</h2>
            <p className="text-gray-600">${product.price}</p>
            <div className="flex justify-between mt-2">
              <Link to={`/product/${product.id}`} className="text-blue-500 underline">عرض التفاصيل</Link>
              <Button onClick={() => addToCart(product)}>
                <ShoppingCart className="mr-2" size={16} /> أضف للسلة
              </Button>
              <Button variant="ghost" onClick={() => toggleFavorite(product)}>
                <Heart
                  className={favorites.includes(product) ? "text-red-500" : "text-gray-400"}
                  size={20}
                />
              </Button>
            </div>
          </CardContent>
        </Card>
      ))}
    </div>
  );
}

function ProductDetails({ match }) {
  const product = products.find((p) => p.id === parseInt(match.params.id));
  if (!product) return <p className="text-center">لم يتم العثور على المنتج</p>;

  return (
    <div className="p-4 text-center">
      <img src={product.image} alt={product.name} className="w-1/2 mx-auto mb-4" />
      <h1 className="text-2xl font-bold">{product.name}</h1>
      <p className="text-gray-600">{product.description}</p>
      <p className="text-lg text-green-600">السعر: ${product.price}</p>
      <Link to="/" className="text-blue-500 underline">العودة إلى المتجر</Link>
    </div>
  );
}

export default function ECommerce() {
  const [cart, setCart] = useState([]);
  const [favorites, setFavorites] = useState([]);

  const addToCart = (product) => {
    setCart([...cart, product]);
  };

  const toggleFavorite = (product) => {
    setFavorites((prev) =>
      prev.includes(product) ? prev.filter((p) => p !== product) : [...prev, product]
    );
  };

  return (
    <Router>
      <Switch>
        <Route path="/product/:id" component={ProductDetails} />
        <Route path="/">
          <ProductList addToCart={addToCart} toggleFavorite={toggleFavorite} favorites={favorites} />
        </Route>
      </Switch>
    </Router>
  );
}
